import React from 'react';
import { Container, Typography, Grid, Paper, Button, Box } from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#90caf9',
    },
    secondary: {
      main: '#f48fb1',
    },
    background: {
      default: '#1c1c1c',
      paper: '#2c2c2c',
    },
    text: {
      primary: '#ffffff',
    },
  },
});

function Pricing() {
  return (
    <ThemeProvider theme={theme}>
      <Container maxWidth="lg" style={{ marginTop: '20px', textAlign: 'center' }}>
        <Typography variant="h3" gutterBottom>
          Plans and Pricing
        </Typography>
        <Grid container spacing={4}>
          <Grid item xs={12} md={4}>
            <Paper style={{ padding: '20px', backgroundColor: '#2c2c2c' }}>
              <Typography variant="h5" gutterBottom>
                Pro <span style={{ color: '#f48fb1' }}>ðŸ”¥ Popular</span>
              </Typography>
              <Typography variant="h4" gutterBottom>
                $17USD
              </Typography>
              <Typography variant="subtitle1" gutterBottom>
                Per 30 days
              </Typography>
              <Typography variant="body1" gutterBottom>
                Great for up & coming resellers
              </Typography>
              <ul style={{ textAlign: 'left' }}>
                <li>Unlimited product checks</li>
                <li>Free vendors with every product</li>
                <li>Single-user account</li>
                <li>20 monitors</li>
                <li>Up to 6 seats</li>
              </ul>
              <Button variant="contained" color="primary">
                Get started with Pro
              </Button>
            </Paper>
          </Grid>
        </Grid>
      </Container>
    </ThemeProvider>
  );
}

export default Pricing;
